import './App.css';
import Title from './Title';
import ProductList from './ProductList';

function App(props) {
  console.log(props);
  return (
    <div className="App">
      <Title />
      <h1>Shop section</h1>
      <ProductList products={props.products} />
    </div>
  );
}
export default App;
